import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="header">
        <h1>
          Better Definitions
        </h1>
      </header>
        <main id={"main-content"}>
            <section id={"d-search"}>
                <input id={"definition-search-input"} placeholder={"Search"}/>
            </section>
        </main>
    </div>
  );
}

export default App;
